import React, { useState, useEffect } from 'react';
import './App.css';
import Parse from "parse/dist/parse.min.js";

const app_id = process.env.REACT_APP_PARSE_APP_ID;
const host_url = process.env.REACT_APP_PARSE_HOST_URL;
const javascript_key = process.env.REACT_APP_PARSE_JAVASCRIPT_KEY;
Parse.initialize(app_id, javascript_key);
Parse.serverURL = host_url;

function App() {
  const [makes, setMakes] = useState([]);
  const [newMakeName, setNewMakeName] = useState('');
  const [newMakeBrand, setNewMakeBrand] = useState('');
  const [newMakeColor, setNewMakeColor] = useState('');
  const [newMakeCategory, setNewMakeCategory] = useState('');

  //READ
  const fetchAllMakes = async () => {
    try {
      const query = new Parse.Query("makes")
      const allMakes = await query.find()
      setMakes(allMakes)
    } catch (error) {
      console.error('Erro na requisição:', error)
    }
  };

  //CREATE
  const createMake = async () => {
    let Makes = new Parse.Object('makes')
    Makes.set('name', "mc saci")
    Makes.set('color', "mc saci")
    Makes.set('category', "mc saci")
    Makes.set('brand', "mc saci")
    try {
      await Makes.save()
      fetchAllMakes()
    } catch (error) { 
      alert('Erro na criação:', error)
    };
  }

  //UPDATE
  const updateMake = async function (makeId, /* done */) {
    let Makes = new Parse.Object('makes');
    Makes.set('objectId', makeId);
    Makes.set('name', "mc saci")
    Makes.set('color', "mc saci")
    Makes.set('category', "mc saci")
    Makes.set('brand', "mc saci")
    try {
      await Makes.save();
    } catch (error) {
      alert('Erro na atualização:', error)
    };
  };

  //DELETE
  const deleteMake = async function (makeId) {
    const Makes = new Parse.Object('makes');
    Makes.set('objectId', makeId);
    try {
      await Makes.destroy();
      fetchAllMakes();
    } catch (error) {
      alert('Erro ao apagar:', error)
    };
  };

  useEffect(() => {
    fetchAllMakes();
  }, []);

  return (
    <div className="app-container">
      <header>
        <h1>Makes</h1>
      </header>
      <main>
        {/* Form for adding/editing makes */}
        <form onSubmit={(e) => {
          e.preventDefault();
          if (newMakeName && newMakeBrand && newMakeColor && newMakeCategory) {
            console.log("Teste")
          } else {
            alert('Please fill out all fields.');
          }
        }}>
          <input type="text" placeholder="Name" value={newMakeName} onChange={(e) => setNewMakeName(e.target.value)} />
          <input type="text" placeholder="Brand" value={newMakeBrand} onChange={(e) => setNewMakeBrand(e.target.value)} />
          <input type="text" placeholder="Color" value={newMakeColor} onChange={(e) => setNewMakeColor(e.target.value)} />
          <input type="text" placeholder="Category" value={newMakeCategory} onChange={(e) => setNewMakeCategory(e.target.value)} />
          <button type="submit">Salvar</button>
        </form>

        {/* List of makes */}
        <ul>
          {makes.map(make => (
            <li key={make.id}>
              <span>Nome: {make.get('name')}</span>
              <span>Marca: {make.get('brand')}</span>
              <span>Cor: {make.get('color')}</span>
              <span>Categoria: {make.get('category')}</span>
              <button onClick={() => console.log('Editar')}>Edit</button>
              <button onClick={() => deleteMake(make.id)}>Delete</button>
            </li>
          ))}
        </ul>
      </main>
      <footer>
        {/* Footer content */}
      </footer>
    </div>
  );
}

export default App;
